import { useState } from 'react';
import { uniq, match, test_guess, make_secret_numb} from './game';
import './App.css';




function App() {

  const [text, setText] = useState("");
  const [guesses, setGuesses] = useState([]);
  const [results, setResults] = useState([]);
  const [numb, setNumb] = useState(make_secret_numb());

  let turns = 8 - guesses.length;

  function updateText(ev) {
    let vv = ev.target.value;
    let cc = vv[vv.length - 1];
    if (!isNaN(cc) || vv === "") {
      setText(vv);
    }
  }

  function guess() {
    if (test_guess(text)) {
      let ng = uniq(guesses.concat(text));
      setGuesses(ng);
      let res = match(numb, text);
      setResults([...results, res]);
      setText("");
    }
  }

  function keyPress(ev) {
    if (ev.key === "Enter") {
      guess();
    }
  }

  function newGame() {
    setText("");
    setGuesses([]);
    setResults([]);
    setNumb(make_secret_numb());
  }

  if (turns <= 0) {
    return <GameOver reset={newGame} />;
  }

  return (
    <div className="App">
      <h1>Bulls and Cows</h1>
      <p>Guess the four-digit number. More information on the game&nbsp;
       <a href="https://en.wikipedia.org/wiki/Bulls_and_Cows" rel="noreferrer" target="_blank">here</a>
        .
      </p>
      <p>
        Input: &nbsp;
        <input type="text"
          value={text}
          onChange={updateText}
          onKeyPress={keyPress} />
        <button onClick={guess}>OK</button>
      </p>
      <table>
        <tr>
          <td></td>
          <th>Guess</th>
          <th>Result</th>
        </tr>
        <tr>
          <td>1</td>
          <td>{guesses[0]}</td>
          <td>{results[0]}</td>
        </tr>
        <tr>
          <td>2</td>
          <td>{guesses[1]}</td>
          <td>{results[1]}</td>
        </tr>
        <tr>
          <td>3</td>
          <td>{guesses[2]}</td>
          <td>{results[2]}</td>
        </tr>
        <tr>
          <td>4</td>
          <td>{guesses[3]}</td>
          <td>{results[3]}</td>
        </tr>
        <tr>
          <td>5</td>
          <td>{guesses[4]}</td>
          <td>{results[4]}</td>
        </tr>
        <tr>
          <td>6</td>
          <td>{guesses[5]}</td>
          <td>{results[5]}</td>
        </tr>
        <tr>
          <td>7</td>
          <td>{guesses[6]}</td>
          <td>{results[6]}</td>
        </tr>
        <tr>
          <td>8</td>
          <td>{guesses[7]}</td>
          <td>{results[7]}</td>
        </tr>
      </table>
      <button onClick={newGame}>New Game</button>
    </div>
  );
}

export default App;
